import React from "react";
import {
    FaDribbbleSquare,
    FaFacebookSquare,
    FaGithubSquare,
    FaInstagram,
    FaTwitterSquare,
} from "react-icons/fa";

const Footer = () => {
    return (
        <div className="max-w-[1240px] mx-auto py-16 px-4 grid lg:grid-cols-3 gap-8 text-gray-300">
            <div>
            <h1 className='w-full text-3xl font-bold text-[#00df9a]'>PRINTXPRESS.</h1>
            <p className="py-4">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat</p>
            <div className="flex">
                <FaFacebookSquares className='size={30}' />
                <FaInstagrams size={30} />
                <FaTwitterSquares size={30} />
                <FaGithubSquares size={30} />
                <FaDribbbleSquares size={30} />
            </div>
            </div>

        </div>
    )
}

export default Footer;
